import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { useState } from "react";

const App = () => {
  const [state, setState] = useState();

  const change = (e) => {
    console.log(state);
    return setState(e.target.value);
  };
  return (
    <div>
      <form>
        <input value={state} onChange={change}></input>
        <button>확인</button>
      </form>
      <div></div>
    </div>
  );
};

export default App;
